from tensorflow import kerasfrom network import mobilenetv2import read_tfrecordimport tensorflow as tfimport configimport osos.environ['TF_CPP_MIN_LOG_LEVEL']='2'os.environ["HDFS_USE_FILE_LOCKING"]='FALSE'cfg = config.cfgdef mobilenetv2_train(train_ds):    base_model, model = mobilenetv2()    model.summary()    model.compile(        optimizer=keras.optimizers.Adam(cfg["lr"]),        loss=tf.keras.losses.SparseCategoricalCrossentropy(from_logits=False),        metrics=["sparse_categorical_accuracy"]    )    model.fit(train_ds, epochs=cfg["epoch"])    model.save(cfg["model_path"])train_db = read_tfrecord.getDataset()train_db = train_db.shuffle(1000).batch(cfg["batch_size"])mobilenetv2_train(train_db)